import classes from './description.module.scss';
import Headline from '../components/Headline';

const Description = () => {
  return (
    <div className={classes.description}>
    <Breadcrumps />
    <DescriptionBody />
    <Headline title={'Related products'} button={'More products'} />
    </div>
  )
}

export default Description
